import React from "react";
import Sidebar from "./Sidebar";
import ManageUsers from "./ManageUsers"; // Import the ManageUsers component
import { Route, Switch, Redirect } from "react-router-dom"; // Import Route, Switch, and Redirect from react-router-dom

const SuperAdminDashboard = () => {
  const userRole = localStorage.getItem("userRole");

  // Access control logic for SuperAdminDashboard
  if (userRole !== "SuperAdmin") {
    return <div>You don't have access to this page.</div>;
  }

  return (
    <div className="d-flex">
      <Sidebar userRole={userRole} />
      <div>
        <h2>Welcome to the SuperAdmin Dashboard</h2>
        <p>This is the dashboard for Superadmin.</p>
        <Switch>
          <Route path="/dashboard/manageusers" component={ManageUsers} />
          <Redirect to="/dashboard" />
        </Switch>
      </div>
    </div>
  );
};

export default SuperAdminDashboard;
